import React from "react";
import './image.css';
export default function Image(){
    return (
        <div class="bgimage">
            <ul>
                <li>Free Medical Camps</li>
                <li>Blood Donation Camps</li>
                <li>Free Ayurvedic Dispensary</li>
                <li>750+ Vaids</li>
            </ul>
        </div>
    )
}
